import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import TeamMemberList from './components/TeamMemberList';
import WorkTeamManagement from './components/WorkTeamManagement';
import AdminUserManagement from './components/AdminUserManagement';
import EventList from './components/EventList';
import VolunteerPointsList from './components/VolunteerPointsList';
import Login from './components/Login';
import './assets/fonts/fonts.css';


function App() {
    const [token, setToken] = useState(localStorage.getItem('token'));
    const [showDropdown, setShowDropdown] = useState(false);  // 新状态用于控制下拉菜单的显示

    useEffect(() => {
        const storedToken = localStorage.getItem('token');
        if (storedToken) {
            setToken(storedToken);
        }
    }, []);

    const handleMouseEnter = () => {
        setShowDropdown(true);
    };

    const handleMouseLeave = () => {
        setShowDropdown(false);
    };

    if (!token) {
        return <Login setToken={setToken} />;
    }

    return (
        <Router>
            <div className={styles.navbarOutter}>
                <div className={styles.rightDiv}>
                    <img src="/pic/NYC.jpg" className={styles.logo} alt="Yacht Club Logo" />
                    <h2>(08) 9386 5496</h2>
                </div>
                <nav className={styles.navbar}>

                    <ul className={styles.navList}>
                        <li><Link className={styles.navLink} to="/"><b>Home</b></Link></li>
                        <li><Link className={styles.navLink} to="/memberManagement"><b>Member management</b></Link></li>
                        <li
                            onMouseEnter={handleMouseEnter}
                            onMouseLeave={handleMouseLeave}
                        >
                            <a><b>Work Team Management</b></a>
                            {showDropdown && (
                                <div className={styles.dropdownContent}>
                                    <Link className={styles.dropdownItem} to="/WorkTeamManagement"><b>View team member</b></Link>
                                    <Link className={styles.dropdownItem} to="/editTeamMember"><b>Edit team member</b></Link>
                                </div>
                            )}
                        </li>
                        <li><Link className={styles.navLink} to="/AdminUserManagement"><b>Admin User Management</b></Link></li>
                        <li><Link className={styles.navLink} to="/volunteer-points"><b>Volunteer Points</b></Link></li>
                        <li><Link className={styles.navLink} to="/events"><b>Events</b></Link></li>
                    </ul>
                </nav>
                <div className={styles.leftDiv}>
                    <button className={styles.logoutButton} onClick={() => { localStorage.removeItem('token'); setToken(null); }}><b>Logout</b></button>
                </div>
            </div>
            <Routes>
                <Route path="/" element={<TeamMemberList />} />
                <Route path="/memberManagement" element={<TeamMemberList />} />
                <Route path="/WorkTeamManagement" element={<WorkTeamManagement />} />
                <Route path="/AdminUserManagement" element={<AdminUserManagement />} />
                <Route path="/events" element={<EventList />} />
                <Route path="/volunteer-points" element={<VolunteerPointsList />} />
                <Route path="/login" element={<Login setToken={setToken} />} />
            </Routes>
        </Router>
    );
}

export default App;
